import React, { Component } from 'react';
import UserService from '../services/UserService';

class UpdateUserComponent extends Component{

  constructor(props) {
    super(props)

    this.state = {
        id: this.props.match.params.id,
        taskName: '',
        description: '',
        startDate: '',
        endDate: '',
        taskStatus: '',
        totalEffortReq: '',
    }
    this.changeTaskNameHandler = this.changeTaskNameHandler.bind(this);
    this.changeDescriptionHandler = this.changeDescriptionHandler.bind(this);
    this.changeStartDateHandler = this.changeStartDateHandler.bind(this);
    this.changeEndDateHandler = this.changeEndDateHandler.bind(this);
    this.changeTaskStatusHandler = this.changeTaskStatusHandler.bind(this);
    this.changeTotalEffortReqHandler = this.changeTotalEffortReqHandler.bind(this);
    this.updateUser = this.updateUser.bind(this);
}

componentDidMount(){
    UserService.getAllTasks(this.state.id).then( (res) =>{
        let user = res.data;
        this.setState({taskName: user.taskName,
          description: user.description,
          startDate : user.startDate,
          endDate : user.endDate,
          taskStatus : user.taskStatus,
          totalEffortReq : user.totalEffortReq
        });
    });
}

updateUser = (e) => {
    e.preventDefault();
    const { history } = this.props;
    let user = {taskName: this.state.taskName, description: this.state.description, startDate: this.state.startDate,
      endDate: this.state.endDate,taskStatus: this.state.taskStatus,totalEffortReq: this.state.totalEffortReq};
    console.log('user => ' + JSON.stringify(user));
    console.log('id => ' + JSON.stringify(this.state.id));
    UserService.updateTask(user, this.state.id).then( res  => {
      history.push('/');
    });
}

changeTaskNameHandler= (event) => {
    this.setState({taskName: event.target.value});
}

changeDescriptionHandler= (event) => {
    this.setState({description: event.target.value});
}

changeStartDateHandler= (event) => {
    this.setState({startDate: event.target.value});
}
changeEndDateHandler= (event) => {
  this.setState({endDate: event.target.value});
}
changeTaskStatusHandler= (event) => {
  this.setState({taskStatus: event.target.value});
}
changeTotalEffortReqHandler= (event) => {
  this.setState({totalEffortReq: event.target.value});
}
cancel = () =>{
  const { history } = this.props;
    history.push('/');
}

render(){
  return (
    <div>
      <h2 className="text-center">Update Task</h2>
      <form>
      <div className="form-group">
      <label>Id</label>
          <input
            type="text"
            placeholder="Id"
            name="id"
            className="form-control"
            value={currentTaskStatus.id}
            onChange={handleInputChange}
          />
          <label>TaskName</label>
          <input
            type="text"
            placeholder="Task Name"
            name="taskName"
            className="form-control"
            value={currentTaskStatus.taskName}
            onChange={handleInputChange}
          />
          <label>Description</label>
          <input
            type="text"
            placeholder="Description"
            name="description"
            className="form-control"
            value={currentTaskStatus.description}
            onChange={handleInputChange}
          />
          <label>TaskStartDate</label>
          <input
            type="text"
            placeholder="TaskStartDate"
            name="startDate"
            className="form-control"
            value={currentTaskStatus.startDate}
            onChange={handleInputChange}
          />
          <label>TaskEndDate</label>
          <input
            type="text"
            placeholder="TaskEndDate"
            name="endDate"
            className="form-control"
            value={currentTaskStatus.endDate}
            onChange={handleInputChange}
          />
          <label>TotalEffortRequired</label>
          <input
            type="text"
            placeholder="TotalEffortRequired"
            name="totalEffortReq"
            className="form-control"
            value={currentTaskStatus.totalEffortReq}
            onChange={handleInputChange}
          />
          <label>TaskStatus</label>
          <input
            type="text"
            placeholder="TaskStatus"
            name="taskStatus"
            className="form-control"
            value={currentTaskStatus.taskStatus}
            onChange={handleInputChange}
          />
        </div>


        {/* Repeat similar blocks for other input fields */}

        <button type="button" className="btn btn-success" onClick={updateTaskStatus.taskStatus}>
          Update
        </button>
        <button type="button" className="btn btn-danger" onClick={cancel}>
          Cancel
        </button>
      </form>
    </div>
  )
 }
}

export default UpdateUserComponent;
